import React, { useState } from 'react';
import { Box, TextField, FormControl, InputLabel, Typography ,Button} from "@mui/material";
import { styled } from '@mui/system';
import { useFormik } from 'formik';
import { Link } from '@mui/material';
import { GoogleMap, LoadScript } from '@react-google-maps/api';


const Profile = () => {
  // const dispatch = useDispatch();
  // const navigate = useNavigate();
  // const [loading, setLoading] = useState(false);
  // const users = useSelector((state) => state.getuser?.getusers);

  const [name, setname] = useState("");
  const [username, setusername] = useState("");
  const [email, setEmail] = useState("");
  const [interest, setInterest] = useState("");
  const [location, setLocation] = useState("");
  const [billingInfo, setBillingInfo] = useState("");
  const StyledTypography = styled(Typography)({
    textTransform: 'uppercase',
    textAlign: 'center',
    marginBottom: 5,
  });

  const StyledButton = styled(Button)({
    width: '100%',
    marginTop: '1rem',
  });


  const {
    values,
    errors,
    touched,
    handleChange,
    handleSubmit,
    handleBlur,
  } = useFormik({
    initialValues: {
      name: '',
      username: '',
      email: '',
      interest: '',
      location: '',
      billingInfo: '',
    },
    // validationSchema: crudopeUser,
    onSubmit: async (values) => {
  //     const [username, setusername] = useState("");
  // const [email, setEmail] = useState("");
  // const [password, setpassword] = useState("");
  // const [rePassword, setrePassword] = useState("");
  // const dispatch = useDispatch();
  //     e.preventDefault();
  //     if (password !== rePassword) {
  //       toast.error("Password does not match");
  //     } else {
  //       signup(dispatch, { username, email, password });
  //       setusername("");
  //       setEmail("");
  //       setpassword("");
  //       setrePassword("");
  //       redirect("/signup")
  //     }
    },
  });

  return (
    <Box
    sx={{
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      minHeight: '100vh',
      backgroundImage: "linear-gradient(to right, rgba(132, 250, 176, 0.5), rgba(143, 211, 244, 0.5))",
    }}
  >
    <Box sx={{ width: '100%', maxWidth: 550, backgroundColor: 'white', padding: '2rem', margin: ".5rem", borderRadius: '15px' }}>
      <Typography variant="h4" sx={{ marginBottom: '1.5rem' }}>Profile</Typography>
      <form onSubmit={handleSubmit}>
          <InputLabel htmlFor="name">Name</InputLabel>
        <FormControl fullWidth sx={{ marginBottom: '1rem' }}>
          <TextField
            id="name"
            name="name"
            variant="outlined"
            value={values.name}
            onChange={handleChange}
            onBlur={handleBlur}
            error={errors.name && touched.name}
          />
        </FormControl>
          <InputLabel htmlFor="username">Username</InputLabel>
        <FormControl fullWidth sx={{ marginBottom: '1rem' }}>
          <TextField
            id="username"
            name="username"
            variant="outlined"
            value={values.username}
            onChange={handleChange}
            onBlur={handleBlur}
            error={errors.username && touched.username}
          />
        </FormControl>
          <InputLabel htmlFor="email">Email</InputLabel>
        <FormControl fullWidth sx={{ marginBottom: '1rem' }}>
          <TextField
            id="email"
            name="email"
            variant="outlined"
            value={values.email}
            onChange={handleChange}
            onBlur={handleBlur}
            error={errors.email && touched.email}
          />
        </FormControl>
        <FormControl fullWidth sx={{ marginBottom: '1rem' }}>
          <InputLabel htmlFor="interests">Interests</InputLabel>
          <TextField
            id="interests"
            name="interests"
            variant="outlined"
            value={values.interests}
            onChange={handleChange}
            onBlur={handleBlur}
            error={errors.interests && touched.interests}
          />
        </FormControl>
        <FormControl fullWidth sx={{ marginBottom: '1rem' }}>
          <InputLabel htmlFor="location">Location</InputLabel>
          <TextField
            id="location"
            name="location"
            variant="outlined"
            value={values.location}
            onChange={handleChange}
            onBlur={handleBlur}
            error={errors.location && touched.location}
          />
        </FormControl>
        <FormControl fullWidth sx={{ marginBottom: '1rem' }}>
          <InputLabel htmlFor="billingInfo">Billing Info</InputLabel>
          <TextField
            id="billingInfo"
            name="billingInfo"
            variant="outlined"
            value={values.billingInfo}
            onChange={handleChange}
            onBlur={handleBlur}
            error={errors.billingInfo && touched.billingInfo}
          />
        </FormControl>
        <Box sx={{ textAlign: 'center' }}>
          <Button type="submit" variant="contained" color="primary">Save</Button>
        </Box>
      </form>
    </Box>
  </Box>
  );
};

export default Profile;
